import React, { useState, useEffect } from 'react';
import axios from 'axios';

function App() {
  const [data, setData] = useState([]);
  console.log(data)
  useEffect(() => {
    axios.get('http://localhost:5000/api/data')
      .then(response => setData(response.data.data))
      .catch(error => console.error('Error fetching data: ', error));
  }, []);

  return (
    <div>
      <h1>Data from SQL Server</h1>
      <table>
        <thead>
          <tr>
            <th>Draw Number</th>
            <th>Date</th>
            <th>No.1</th>
            <th>No.2</th>
            <th>No.3</th>
            <th>No.4</th>
            <th>No.5</th>
            <th>No.6</th>
            <th>Bonus</th>
            {/* Add more table headers if needed */}
          </tr>
        </thead>
        <tbody>
          {data.map(item => (
            <tr key={item.DrawNumber}>
              <td>{item.DrawNumber}</td>
              <td>{item.DrawDate}</td>
              <td>{item.Number1}</td>
              <td>{item.Number2}</td>
              <td>{item.Number3}</td>
              <td>{item.Number4}</td>
              <td>{item.Number5}</td>
              <td>{item.Number6}</td>
              <td>{item.Bonus}</td>
              {/* Add more table cells if needed */}
            </tr>
          ))}
        </tbody>
      </table>
    </div>);
}

export default App;
